        //     style: {
        //         backgroundColor: '#000000', borderRadius: 30, margin: 24, height: 72, width: '90%',
        //         labelStyle: { fontSize: 2 },
        //     }
        // }}
        >

            <Tabs.Screen
                name="Logistic"
                component={Logisticscreen}
            />
            
            <Tabs.Screen
                name="Store"
                component={Ecommerce}
                options={{
      headerShown: false,}}
            />
            <Tabs.Screen
                name="Social Media"
                component={SocialMedia}
            />

            <Tabs.Screen
                name="Yoris Pay"
                component={Fintech1}
                options={{
      headerShown: false,}}
            />


        </Tabs.Navigator >


    )

}



